from befree.api_model.config.headers import Headersfrom befree.api_model.orders.public.delivery.endpoints import Endpointsfrom befree.api_model.orders.public.delivery.payloads import Payloadsfrom befree.api_model import apifrom requests import Responseclass Delivery:    def __init__(self):        self._endpoints = Endpoints()        self._payloads = Payloads()        self._headers = Headers()    def get_delivery_methods(        self,        cart_uuid,        fias_id="c2deb16a-0330-4f05-821f-1d09c93331e6",        golden_record="sank-823938",    ):        response: Response = api.orders_session.post(            url=self._endpoints.get_delivery_methods,            data=self._payloads.get_delivery_methods(                cart_uuid=cart_uuid,                fias_id=fias_id,                golden_record=golden_record,            ),            headers=self._headers.common,        )        return response    def delivery_methods_availability(        self, cart_uuid, fias_id="c2deb16a-0330-4f05-821f-1d09c93331e6", golden_record="sank-823938"    ):        response: Response = api.orders_session.post(            url=self._endpoints.delivery_methods_availability,            data=self._payloads.delivery_methods_availability(                cart_uuid=cart_uuid,                fias_id=fias_id,                golden_record=golden_record,            ),            headers=self._headers.common,        )        return response    def get_intervals(        self, cart_uuid, address, fias_id="c2deb16a-0330-4f05-821f-1d09c93331e6", golden_record="sank-823938"    ):        response: Response = api.orders_session.post(            url=self._endpoints.get_intervals,            data=self._payloads.get_intervals(                cart_uuid=cart_uuid, fias_id=fias_id, golden_record=golden_record, address=address            ),            headers=self._headers.common,        )        return response    def get_pickpoints(        self, cart_uuid, methods, fias_id="c2deb16a-0330-4f05-821f-1d09c93331e6", golden_record="sank-823938"    ):        response: Response = api.orders_session.post(            url=self._endpoints.get_pickpoints,            data=self._payloads.get_pickpoints(                cart_uuid=cart_uuid, fias_id=fias_id, golden_record=golden_record, methods=methods            ),            headers=self._headers.common,        )        return response